import React from 'react';

const taskOwner = (props) => {
    return (
        <div>
            first Name: <input type="text" value = {props.fname} />
            last Name: <input type="text" value = {props.lname} />
            Task: <textarea value = {props.task} />
        </div>
    );
};

export default taskOwner;
